import React from "react";

function Buy () {
    return(
        <div className="container-buy">
            <p>Buy</p>
            <a href="https://www.binance.com"><img alt="" data-src="https://public.bnbstatic.com/image/cms/blog/20210727/d5e64913-dcf6-4bd7-9393-40261297e968.jpeg" class="mica-lazy-img css-1v2m5vo" src="https://public.bnbstatic.com/image/cms/blog/20210727/d5e64913-dcf6-4bd7-9393-40261297e968.jpeg"></img></a>
        </div>
    );
}

export default Buy;
